import React, { Component } from 'react'
import { Switch, Route, Redirect } from 'react-router-dom';
import { MDBBtn, MDBCollapse } from 'mdbreact';
import { Card, CardTitle,Nav, Navbar,  NavbarToggler, Collapse, NavItem }
from 'reactstrap';
import { NavLink } from 'react-router-dom';

import {BrowserRouter, withRouter} from 'react-router-dom';
import { Contacts } from './ContactComponent';
import { Home } from './HomeComponent';
import { Tools } from './ToolsComponent'
import { TransitionGroup, CSSTransition }from 'react-transition-group';
import { Test } from './TestComponent';


class Main extends Component {
  constructor(props) {
    super(props);
    this.state = {
      collapseID: "",
      isNavOpen: false,
    };
  this.toggleNav = this.toggleNav.bind(this);
  };

  toggleCollapse = collapseID => () => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  }
  toggleNav() {
    this.setState({
      isNavOpen: !this.state.isNavOpen
    });
  }

  render() {

  return (

  <React.Fragment className="header col-12 col-md-10 ">
      <Test />
    <MDBBtn
      className="col-5 col-sm-7 col-md-12 m-1 btn btn-dark btn-circle btn-xl"
      onClick={this.toggleCollapse("basicCollapse")}>
      <i class="d-none d-md-block fa fa-cog fa-spin fa-3x fa-fw"></i>    
    </MDBBtn>
    <MDBCollapse id="basicCollapse" isOpen={this.state.collapseID}>    
    <div className="container">
      <div className="row ">
        <Card id="card"  >
          <CardTitle className='row justify-content-center'>
          <Navbar dark expand="md" >
          <div className="container">
            <NavbarToggler  onClick={this.toggleNav} />    
            <Collapse isOpen={this.state.isNavOpen} navbar>
              <Nav navbar id="nav">
              <NavItem>
                  <NavLink className="nav-link"  to='/home'><span className="fa fa-home fa-lg"></span> Home</NavLink>
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/aboutus'><span className="fa fa-info fa-lg"></span> About Us</NavLink>
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/menu'><span className="fa fa-list fa-lg"></span> Menu</NavLink>
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/contactus'><span className=" fa fa-address-card fa-lg"></span> Contact Us</NavLink>
              </NavItem>
              </Nav>
            </Collapse>
          </div>
      </Navbar>
          </CardTitle>

          <TransitionGroup >
            <CSSTransition key={this.props.location.key} classNames="fade" timeout={{ enter: 300, exit: 300 }}>
            <section className="route-section">
          <Switch location={this.props.location}>
            <Route path="/home" component={Home} />
            <Route path="/tools" component={Tools} />
            <BrowserRouter>
              <div className='hoss '>
                <Contacts />
              </div>
            </BrowserRouter>        
            <Redirect to="/home" />
          </Switch>
          </section>
          </CSSTransition>
          </TransitionGroup>

        </Card>
      </div>
    </div>

    </MDBCollapse>
  </React.Fragment>
    )
  }
}

export default withRouter(Main);
